import React from 'react';
import { useEffect } from 'react';
import { useState } from 'react';




const App = () =>{
    const[num,Setnum] = useState(0);

    useEffect(()=>{
        alert(" I am clicked")
    } , [num])
    const Inc = () =>{
        let newNum = num + 1;
        Setnum(newNum);
    }
    return(
        <>
        <button onClick={Inc}> Click me {num} </button>
        </>
    )
}

export default App;
